import React from 'react';
import '../../App.css';

export default function Gallery() {
  return (
    <>
      <div className='gallery'>
        <h1>GALLERY</h1>
        <div className='gallery_containers'>
          <ul className='gallery_items'>
            src='images/gallery-1.jpg';
          </ul>
        </div>
      </div>
    </>
  );
}
